INSERT INTO `lottery_play_class_group` VALUES (1837, 122, 1258, '1515', '15151', '1515110', '千位', '投注方案~万位3、千位4、百位5、个位1\n示例号码：\n3451，即中直选复式。', '从千、百、十、个四位，每个位置至少选择1个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即中奖。', 1, 1, '2021-01-07 10:46:02', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1838, 122, 1259, '1515', '15151', '1515111', '百位', '投注方案~万位3、千位4、百位5、个位1\n示例号码：\n3451，即中直选复式。', '从千、百、十、个四位，每个位置至少选择1个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即中奖。', 1, 2, '2021-01-07 10:46:02', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1839, 122, 1260, '1515', '15151', '1515112', '十位', '投注方案~万位3、千位4、百位5、个位1\n示例号码：\n3451，即中直选复式。', '从千、百、十、个四位，每个位置至少选择1个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即中奖。', 1, 3, '2021-01-07 10:46:02', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1840, 122, 1261, '1515', '15151', '1515113', '个位', '投注方案~万位3、千位4、百位5、个位1\n示例号码：\n3451，即中直选复式。', '从千、百、十、个四位，每个位置至少选择1个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即中奖。', 1, 4, '2021-01-07 10:46:02', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1841, 122, 1262, '1516', '15161', '1516110', '二码不定位', '投注方案~85\n示例号码：\n5812或者8125，即中二码不定位。', '从0-9个号码中任选2个或2个以上的号码进行投注，每注由2个不同的号码组成，当期开奖结果包含所选号码，即为中奖。', 1, 1, '2021-01-07 10:45:43', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1842, 122, 1263, '1517', '15171', '1517110', '三码不定位', '投注方案~851\n示例号码：\n5812或者8521，即中不定位三。', '从0-9个号码中任选3个或3个以上的号码进行投注，每注由3个不同的号码组成，当期开奖结果包含所选号码，即为中奖。', 1, 1, '2021-01-07 10:46:34', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1843, 122, 1264, '1518', '15181', '1518110', '千位', '投注方案~千位大。\n示例号码：\n千位8，即中两面千位大小单双。', '从千位中的“大（56789）、小（01234）、单（13579）、双（02468）”中至少选一个组成一注，所选号码的位置、形态与开奖号码的位置、形态相同，即为中奖。', 1, 1, '2021-01-07 10:49:25', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1844, 122, 1365, '1518', '15181', '1518111', '百位', '投注方案~百位大。\n示例号码：\n百位8，即中两面百位大小单双。', '从百位中的“大（56789）、小（01234）、单（13579）、双（02468）”中至少选一个组成一注，所选号码的位置、形态与开奖号码的位置、形态相同，即为中奖。', 1, 2, '2021-01-07 10:49:25', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1845, 122, 1365, '1518', '15181', '1518112', '十位', '投注方案~十位大。\n示例号码：\n十位8，即中两面十位大小单双。', '从十位中的“大（56789）、小（01234）、单（13579）、双（02468）”中至少选一个组成一注，所选号码的位置、形态与开奖号码的位置、形态相同，即为中奖。', 1, 3, '2021-01-07 10:49:25', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1846, 122, 1365, '1518', '15181', '1518113', '个位', '投注方案~个位大。\n示例号码：\n个位8，即中两面个位大小单双。', '从个位中的“大（56789）、小（01234）、单（13579）、双（02468）”中至少选一个组成一注，所选号码的位置、形态与开奖号码的位置、形态相同，即为中奖。', 1, 4, '2021-01-07 10:49:25', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1847, 122, 1366, '1518', '15181', '1518114', '和值', '投注方案~单。\n示例号码：\n8889，四个号码和值为33（即单），即中和值大小单双。', '从单、双、大、小四个号码中至少选一个组成一注，所选号码与开奖号码的四个号码和值属性一致即为中奖（0-17为小，18-36为大，和值奇数为单，和值偶数为双）', 1, 5, '2021-01-07 10:54:14', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1848, 122, 1367, '1519', '15191', '1519110', '千位', '投注方案~千位1\n示例号码：\n千位1，即中定位胆千位', '从千位任意位置上至少选择一个以上号码，所选号码与相同位置上的开奖号码一致，即为中奖。', 1, 1, '2021-01-07 10:50:41', '2020-12-16 15:00:00');
